import React from "react";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Form from "react-bootstrap/Form";

const NavBar = () => {
  const user = localStorage.getItem("access_token");
  return (
    <div>
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand to="#home">Navbar</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link to="#home">Home</Nav.Link>
          <Nav.Link to="#features">Features</Nav.Link>
          <Nav.Link to={`/article`}>Add</Nav.Link>
          <Nav.Link to={`/sub`}>Add Sub</Nav.Link>
        </Nav>
        <Form inline>
          {user ? (
            <Nav.Link to="/logout">Logout</Nav.Link>
          ) : (
            <Nav.Link to="/user/login">Login</Nav.Link>
          )}
        </Form>
      </Navbar>
    </div>
  );
};

export default NavBar;
